import { Route } from 'react-router-dom'
import "./App.css";
import Events from "./views/Events";
import Homepage from "./views/Homepage";

function App() {
  return (
    <div>
      <Route path="/homepage"> <Homepage/> </Route>
      <Route path="/events"> <Events/> </Route>
    </div>

  );
}

export default App;
